import React from "react";
import "./Styles/Main.css";

// 1페이지
const Main = () => {
  return (
    <div className="wrap">
      <div className="container">
        <div className="text">
          <p>화면을 터치해주세요</p>
        </div>
      </div>

      <div className="rect" />
    </div>
  );
};

export default Main;
